import React from 'react';
import ReactDOM  from 'react-dom';
import './App.css'; 

const Title = () => (
  <a href='/'>
    <h1>Food Villa</h1>
  </a>
);
const HeaderComponent = () => {
  return(
    <div className='header'>
      <Title/>
      <div className='navitems'>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact Us</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};



const resturantlist = [
