]


const ResturantCard = () =>{
  return(
    <div className='card'>
      <img src='https://res.cloudinary.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_508,h_320,c_fill/9b0328e05e8cb535d744b6ab406c8e18'/>
      <h2>{resturantlist[1].info?.name}</h2>
      <h3>{resturantlist[0].info?.category}</h3>
      <h4>{resturantlist[0].info?.price}</h4>
    </div>
  );
}

const Body =() =>{
  return(
  <div className='resturantlist'>
  <ResturantCard/>
  <ResturantCard/>
  <ResturantCard/>
  <ResturantCard/>

  </div>
  )
}
const Footer =() =>{
  return(
    <h1>Footer</h1>
  )
}
const Applayout = ()=>{
  return(
    <>
    <HeaderComponent/>
     <Body/>
     <Footer/>
      </>
  );
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Applayout/>);
